import React, { Component } from 'react';
import {
    Link
} from 'react-router-dom';

class Nav extends Component{
    
    render(){
        return(
            <div>
                <ul>
                    <li>
                        <Link to="/">Inicio</Link>
                    </li>
                    <li>
                        <Link to="/productos">Productos</Link>
                    </li>
                </ul>
            </div>
        );
    }

}
export default Nav;
